import React from 'react';

const Textbox = initial_text => {
  return (
    <div>
      <textarea
        rows='4'
        cols='50'
        name='comment'
        form='usrform'
        className='#ffebee red lighten-5'
        style={{ height: '500px' }}
      >
        {initial_text}
      </textarea>
    </div>
  );
};
Textbox.propTypes = {
  initial_text: PropTypes.string.isRequired
};

export default Textbox;
